styles.content:
self {
  background: linear-gradient(to bottom, rgba(39,170,225,.8), rgba(28,117,188,.8)), url(https://raw.githubusercontent.com/4d/Web-studio-TIPS/gh-build/groups/enterprise-social-network/assets/office.jpg) no-repeat;
    background-image: linear-gradient(rgba(39, 170, 225, 0.8), rgba(28, 117, 188, 0.8)), url(https://raw.githubusercontent.com/4d/Web-studio-TIPS/gh-build/groups/enterprise-social-network/assets/office.jpg);
    background-position-x: initial, initial;
    background-position-y: initial, initial;
    background-size: initial, initial;
    background-repeat-x: initial, no-repeat;
    background-repeat-y: initial, no-repeat;
    background-attachment: initial, initial;
    background-origin: initial, initial;
    background-clip: initial, initial;
    background-color: initial;
  background-color : #3b82f6ce;
  padding-left : 100px;
  color : #ffffffff;
}

self {
	display : flex;
	align-items : center;
	gap : 10px;
	cursor: pointer;
	border-bottom-style: solid;
	border-bottom-width : 1px;
	border-bottom-color: #f1f2f2;
}

self {
    background: linear-gradient(to bottom, rgba(141,198,63, 1), rgba(0,148,68, 1));
	border: none;
	height: 12px;
	width: 12px;
	border-radius: 50%;
	position: absolute;
	bottom: 6px;
	margin: auto;
	right : 10px;
}

self {
  border-width : 1px;
  border-radius : 4px;
  border-color : #ccc;
  height : 50px;
  min-width : 300px;
  padding-left : 8px;
}

self {
  color : #6d6e71;
	cursor: pointer;
}
self:hover{
	color: #28aae1;

}

self {
  font-weight : 700;
  text-decoration : underline;
  color : #337ab7;
	cursor: pointer;
	font-size: 14px;
}
